// src/components/Home.js
import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div style={{ textAlign: 'center', padding: '20px' }}>
      <h1 style={{ fontSize: '48px', margin: '20px 0' }}>Welcome to Web DailiGo</h1>
      <p style={{ fontSize: '24px', margin: '20px 0' }}>
        Your one-stop platform for managing your learning experience. 
        <br />
        Whether you're a new student or a returning learner, we have something for you!
      </p>
      <p style={{ fontSize: '20px', margin: '20px 0' }}>
        Please register or log in to access more features.
      </p>
      <div style={{ marginTop: '30px' }}>
        <Link to="/register" style={{ 
          textDecoration: 'none', 
          marginRight: '20px', 
          backgroundColor: 'blue', 
          color: 'white', 
          padding: '15px 30px', 
          fontSize: '20px', 
          borderRadius: '5px' 
        }}>
          Register
        </Link>
        <Link to="/login" style={{ 
          textDecoration: 'none', 
          backgroundColor: 'blue', 
          color: 'white', 
          padding: '15px 30px', 
          fontSize: '20px', 
          borderRadius: '5px' 
        }}>
          Login
        </Link>
      </div>
    </div>
  );
};

export default Home;
